	      // equal. Otherwise, they may still be equivalent, but we'll need to
	      // ask the server to check for us.
	      if (ids[0] === ids[1]) {
	        return true;
	      }

	      let cmd = new command.Command(command.Name.ELEMENT_EQUALS);
	      cmd.setParameter('id', ids[0]);
